import React from 'react';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuItem from '@mui/material/MenuItem';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Container from '@mui/material/Container';
import MenuIcon from '@mui/icons-material/Menu';
import SearchIcon from '@mui/icons-material/Search';
import { useState } from 'react';

function NavScrollExample() {
    const [anchorEl, setAnchorEl] = useState(null);

    const handleMenuOpen = (event) => {
        setAnchorEl(event.currentTarget);
    };

    const handleMenuClose = () => {
        setAnchorEl(null);
    };

    return (
        <AppBar position="static" color="default">
            <Container maxWidth="xl">
                <Toolbar disableGutters>
                    <Typography
                        variant="h6"
                        noWrap
                        component="a"
                        href="#"
                        sx={{
                            mr: 2,
                            display: { xs: 'none', md: 'flex' },
                            fontWeight: 700,
                            color: 'orange',
                            textDecoration: 'none',
                        }}
                    >
                        <strong>GIS</strong>
                    </Typography>

                    <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' } }}>
                        <Button href="#action1" sx={{ my: 2, color: 'black', display: 'block' }}>
                            Home
                        </Button>

                        <Button
                            onClick={handleMenuOpen}
                            sx={{ my: 2, color: 'black', display: 'block' }}
                        >
                            File
                        </Button>
                        <Menu
                            id="navbarScrollingDropdown"
                            anchorEl={anchorEl}
                            open={Boolean(anchorEl)}
                            onClose={handleMenuClose}
                        >
                            <MenuItem onClick={handleMenuClose} href="#action3">Upload</MenuItem>
                            <MenuItem onClick={handleMenuClose} href="#action4">Download</MenuItem>
                            <MenuItem onClick={handleMenuClose} divider />
                            <MenuItem onClick={handleMenuClose} href="#action5">View</MenuItem>
                        </Menu>
                    </Box>

                    <Box sx={{ flexGrow: 1 }} />
                    <Box sx={{ display: 'flex' }}>
                        <TextField
                            variant="outlined"
                            placeholder="Search"
                            size="small"
                            sx={{ mr: 2 }}
                        />
                        <Button variant="outlined" startIcon={<SearchIcon />}>
                            Search
                        </Button>
                    </Box>
                </Toolbar>
            </Container>
        </AppBar>
    );
}

export default NavScrollExample;
